import React from 'react';
import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from './KwikComponent/Home';
import Percentalcal from './Components/HomeComponent/Percentalcal';
import Banner from './Components/HomeComponent/Banner';
import SearchWeather from './Components/HomeComponent/WeatherApp';


function App() {

  return (
    <div className="App">
     <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/percent" element={<Percentalcal/>}/>
      <Route path="/frequ" element={<Banner />}/>
      <Route path="/weather" element={<SearchWeather />}/>
    </Routes>
  </BrowserRouter>
    </div>
  );
}

export default App;
